#
# Structure for table "konfirmasi"
#

DROP TABLE IF EXISTS `konfirmasi`;
CREATE TABLE `konfirmasi` (
  `idkonfirmasi` int(11) NOT NULL AUTO_INCREMENT,
  `nama` varchar(255) DEFAULT NULL COMMENT 'pembayaran atas nama',
  `nominal` varchar(255) DEFAULT NULL,
  `tujuan` varchar(255) DEFAULT NULL COMMENT 'rekening tujuan',
  `status` varchar(255) DEFAULT NULL COMMENT '0 = sudah dibaca, 1=belum dibaca',
  PRIMARY KEY (`idkonfirmasi`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

