#
# Structure for table "list_kerja"
#

DROP TABLE IF EXISTS `list_kerja`;
CREATE TABLE `list_kerja` (
  `idlist` int(11) NOT NULL AUTO_INCREMENT,
  `idpegawai` varchar(11) NOT NULL DEFAULT '',
  `idproduk` varchar(11) NOT NULL,
  `tanggal` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `status` varchar(255) NOT NULL DEFAULT '0 = progres , 1= selesai',
  PRIMARY KEY (`idlist`),
  KEY `FK_PRODUK_idx` (`idpegawai`),
  KEY `FK_PROD_idx` (`idproduk`),
  CONSTRAINT `FK_PRODUKSI` FOREIGN KEY (`idpegawai`) REFERENCES `pegawai` (`idpegawai`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

