#
# Structure for table "order"
#

DROP TABLE IF EXISTS `order`;
CREATE TABLE `order` (
  `idorder` varchar(255) NOT NULL DEFAULT '',
  `idcustomer` varchar(11) DEFAULT NULL,
  `idproduk` varchar(11) DEFAULT NULL,
  `idpegawai` varchar(11) DEFAULT '0',
  `tgl_order` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `tgl_selesai` varchar(255) DEFAULT NULL,
  `status` varchar(2) DEFAULT '0' COMMENT '0 = order , 1 = progres , 2 = selesai, 3 = diambil',
  PRIMARY KEY (`idorder`),
  KEY `FK_CUSTOMER_idx` (`idcustomer`),
  KEY `FK_PRODUK_idx` (`idproduk`),
  KEY `FK_PEGAWAI_idx` (`idpegawai`),
  CONSTRAINT `FK_CUSTOMER` FOREIGN KEY (`idcustomer`) REFERENCES `customer` (`idcustomer`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_PEGAWAI` FOREIGN KEY (`idpegawai`) REFERENCES `pegawai` (`idpegawai`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_PRODUK` FOREIGN KEY (`idproduk`) REFERENCES `produk` (`idproduk`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

